import Homepage from "./Layout/Homepage";
import LoginPage from "./Layout/loginPage";
import NewsFeedPage from "./Layout/NewsFeedPage";
import SignupPage from "./Layout/signupPage";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import CategoryPage from "./Layout/CategoryPage";
import ArticlePage from "./Layout/ArticlePage";

function App() {
  return (
    <>
      <BrowserRouter>
        <Routes>
          <Route exact path="/login" element={<LoginPage />} />
          <Route path="/signup" element={<SignupPage />} />
          <Route
            path="/"
            element={checkAuth() ? <Homepage /> : <LoginPage />}
          />
          <Route path="/newsfeed" element={<NewsFeedPage />} />
          <Route
            path="/category/:categoryName"
            element={checkAuth() ? <CategoryPage /> : <LoginPage />}
          />

          {/* <Route exact path='/new/signin' element={<NewSignin />} /> /}
          <Route exact path="/add" element={<AddCategoryDatabase />} />
          <Route exact path="/addp" element={<AddProductDatabase />} />
          <Route exact path="/admin/dashboard" element={<Dashboard />} />
          {/ <Route path="/*" element={<Navigate to ="/" />}/> */}
        </Routes>
      </BrowserRouter>
    </>
  );
}

export default App;
